K.H.J. Buschow Ph.D., &quot;Concise Encyclopedia of Magnetic and Superconducting Materials&quot;
Elsevier Science | 2006 | ISBN: 0080445861 | 1360 pages | PDF

This concise encyclopedia brings together newly commissioned articles as well as articles revised from the acclaimed Encyclopedia of Materials and Engineering; encompassing all areas of magnetic and superconducting materials systems and their properties, including key topics such as thin films.
